interface RolesSearchProps {
  selectedProduct?: Product;
}
export default function RolesSearch({ selectedProduct }: RolesSearchProps) {
  const [users, setUsers] = useState<Array<Role>>([]);
  const [page, setPage] = useState<Page>({ number: 0, size: process.env.REACT_APP_ROLES_PAGE_SIZE, totalElements: 0, totalPages: 0 });
  const [filter, setFilter] = useState<RolesSearchFilterConfig>(
    selectedProduct ? { product: selectedProduct.id } : {}
  );
  const [pageRequest, setPageRequest] = useState<PageRequest>({
    page: 0,
    size: process.env.REACT_APP_ROLES_PAGE_SIZE,
  });
  const fetchUsers = (_f: RolesSearchFilterConfig, pageRequest: PageRequest) => {
    // TODO Fetch
    setUsers(pageRequest.page === 9 ? mockedUsers.slice(1,5):mockedUsers); // TODO (fare setUser con mio createData) e setPage
    setPage({ number: pageRequest.page, size: pageRequest.size, totalElements: 195, totalPages: 10 });
  };

  useEffect(() => {
    fetchUsers(filter, pageRequest);
  }, []);

  const handleFilterChange = (f: RolesSearchFilterConfig) => {
    setFilter(f);
    fetchUsers(f, pageRequest);
  };
  const handlePageRequestChange = (p: PageRequest) => {
    setPageRequest(p);
    fetchUsers(filter, p);
  };

  return (
      <Grid container alignItems={'center'} >
        <Grid item xs={10}>
          <RolesSearchFilter
            filterProducts={selectedProduct === undefined}
            filter={filter}
            onFilterChange={handleFilterChange}
          />
        </Grid>
        <Grid item xs={2}>
          <Button variant="contained" startIcon={<AddIcon />}>
            {/* TODO open addUserForm */}
            Aggiungi
          </Button>
        </Grid>

        <Grid item xs={12} my={8} >
          <Box>
            <RolesSearchTable
              users={users}
              selectedProduct={selectedProduct}
              page={page}
              sort={pageRequest.sort}
              onPageRequest={handlePageRequestChange}
            />
          </Box>
        </Grid>
      </Grid>
  );
}
